import React, { useState, useEffect } from 'react';
import {
  Box,
  Paper,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  IconButton,
  Chip,
  CircularProgress,
  Alert,
  Tooltip,
  Card,
  CardContent,
  Grid,
} from '@mui/material';
import {
  Visibility,
  ThumbUp,
  Comment,
  Share,
  TrendingUp,
} from '@mui/icons-material';

const ContentHistory = () => {
  const [posts, setPosts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [analytics, setAnalytics] = useState({
    totalPosts: 0,
    totalEngagements: 0,
    averageLikes: 0,
    topPerforming: null,
  });

  useEffect(() => {
    fetchContentHistory();
  }, []);

  const fetchContentHistory = async () => {
    setLoading(true);
    try {
      const response = await fetch(`${process.env.REACT_APP_API_URL}/api/content/history`, {
        credentials: 'include',
      });

      if (!response.ok) {
        throw new Error('Failed to fetch content history');
      }

      const data = await response.json();
      setPosts(data.posts || []);
      calculateAnalytics(data.posts || []);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  const calculateAnalytics = (posts) => {
    if (!posts.length) return;

    const totalPosts = posts.length;
    const totalEngagements = posts.reduce(
      (sum, post) => sum + post.likes + post.comments + post.shares,
      0
    );
    const averageLikes = Math.round(
      posts.reduce((sum, post) => sum + post.likes, 0) / totalPosts
    );
    const topPerforming = posts.reduce((top, post) =>
      post.likes + post.comments + post.shares >
      (top ? top.likes + top.comments + top.shares : 0)
        ? post
        : top
    );

    setAnalytics({
      totalPosts,
      totalEngagements,
      averageLikes,
      topPerforming,
    });
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'short',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit',
    });
  };

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', py: 4 }}>
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Box sx={{ p: 3 }}>
        <Alert severity="error">{error}</Alert>
      </Box>
    );
  }

  return (
    <Box sx={{ p: 3 }}>
      {/* Analytics Overview */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} md={3}>
          <Card>
            <CardContent>
              <Typography color="textSecondary" gutterBottom>
                Total Posts
              </Typography>
              <Typography variant="h4">{analytics.totalPosts}</Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} md={3}>
          <Card>
            <CardContent>
              <Typography color="textSecondary" gutterBottom>
                Total Engagements
              </Typography>
              <Typography variant="h4">{analytics.totalEngagements}</Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} md={3}>
          <Card>
            <CardContent>
              <Typography color="textSecondary" gutterBottom>
                Average Likes
              </Typography>
              <Typography variant="h4">{analytics.averageLikes}</Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} md={3}>
          <Card>
            <CardContent>
              <Typography color="textSecondary" gutterBottom>
                Best Performing Post
              </Typography>
              <Typography variant="h4">
                {analytics.topPerforming?.likes || 0} likes
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Content Table */}
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Date</TableCell>
              <TableCell>Content</TableCell>
              <TableCell>Status</TableCell>
              <TableCell align="center">Likes</TableCell>
              <TableCell align="center">Comments</TableCell>
              <TableCell align="center">Shares</TableCell>
              <TableCell align="center">Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {posts.map((post) => (
              <TableRow key={post.id}>
                <TableCell>{formatDate(post.created_at)}</TableCell>
                <TableCell>
                  <Typography noWrap sx={{ maxWidth: 300 }}>
                    {post.content}
                  </Typography>
                </TableCell>
                <TableCell>
                  <Chip
                    label={post.status}
                    color={
                      post.status === 'published'
                        ? 'success'
                        : post.status === 'scheduled'
                        ? 'warning'
                        : 'default'
                    }
                    size="small"
                  />
                </TableCell>
                <TableCell align="center">
                  <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                    <ThumbUp fontSize="small" sx={{ mr: 1 }} />
                    {post.likes}
                  </Box>
                </TableCell>
                <TableCell align="center">
                  <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                    <Comment fontSize="small" sx={{ mr: 1 }} />
                    {post.comments}
                  </Box>
                </TableCell>
                <TableCell align="center">
                  <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                    <Share fontSize="small" sx={{ mr: 1 }} />
                    {post.shares}
                  </Box>
                </TableCell>
                <TableCell align="center">
                  <Tooltip title="View on LinkedIn">
                    <IconButton
                      size="small"
                      onClick={() => window.open(post.linkedin_url, '_blank')}
                    >
                      <Visibility />
                    </IconButton>
                  </Tooltip>
                  <Tooltip title="View Analytics">
                    <IconButton size="small">
                      <TrendingUp />
                    </IconButton>
                  </Tooltip>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default ContentHistory;
